import org.apache.commons.io.IOUtils
import collection.JavaConverters._

var SI = sc.textFile("hdfs://localhost:9000/input/kospi_info.csv")

case class stockInfo(codeNum:String, name:String)
val itemInfo = SI.map(s=>s.split(","))
        .map(s=>stockInfo(s(0),s(1)))

itemInfo.toDF().registerTempTable("itemInfo")

val selectOptions = SI.map(s=>s.split(","))
        .map(s=>(s(1))).collect()

z.angularBind("options",selectOptions)
z.angularBind("selectCodes","동화약품")

val selectedCodeNumContext = z.getInterpreterContext()

z.angularUnwatch("selectCodes")
z.angularWatch("selectCodes", (befor:Object,after:Object) => {
    for( listNum <- 5 to 11 by 3 ) {
        z.run(List(listNum).asJava.asInstanceOf[java.util.List[Object]],selectedCodeNumContext)
    }
    for( listNum <- 13 to 15 by 2 ) {
        z.run(List(listNum).asJava.asInstanceOf[java.util.List[Object]],selectedCodeNumContext)
    }
    for( listNum <- 21 to 27 by 6 ) {
        z.run(List(listNum).asJava.asInstanceOf[java.util.List[Object]],selectedCodeNumContext)
    }
})
